INSERT INTO `songs` (`songs_id`, `artist_name`, `song_name`, `song_text`) VALUES
(1, 'Найтивыход', '68 собак', 'Шимпанзе из семейства приматов\r\nЛианы для баттловых дегенератов\r\nПланирует прыгать с ветки на ветку\r\nИ треки лепить, не слезая со стула\r\n\r\nВ шестидесяти восьми собаках\r\nУехать, как Паша в три года назад\r\nПросто сесть и уехать в фонарные столбики\r\nГде почему-то мы все умирали\r\n\r\nНа шестидесяти восьми страницах\r\nНа лайвах читать, еле в бит попадая\r\nПро фуникулеры и вишенок финиш\r\nКовер, что на стену повешу я в мае\r\nРаспечатаю постер, уеду в собаке\r\nЧтоб больше не видеть как вы тут живете\r\nБольше не видеть как телочки плачут\r\nРазевая пасть как кашалотик\r\n\r\nЯ уеду в собаках-лайках\r\nНа постах, где репостов до ста\r\nНа места все расставлю в шишечный стафф\r\nЭто питерский флоу звезды-наркомана\r\nВ шестьдесят восьмом, говорил мне дед\r\nУезжали в саббате на плоте в Терек\r\nУеду в свой космос на велике\r\nКислым сахаром, в небе приветами\r\n\r\nЭто достаточно абстрактно чтобы\r\nМожно было врать, что тут до кучи смысла?\r\nИ шестьдесят восемь - хуевые числа\r\nДаже тут по логике не с чем связать\r\nНесчастливые цифры, программа зависла\r\nС намеком на экзистенциальность\r\nНо только ведь это хип-хоп баттл\r\nТут, брат\r\nПопробовать можно хотя бы…\r\n\r\n68 собак\r\nВ них Паша уехал назад\r\nЭто круче, чем смерть на футболе\r\nИ секс, и признание девочек в школе\r\n68 собак\r\nВ них Паша уехал назад\r\nВсего на три года угнал в далматине\r\nА кажется, будто на все четыре\r\n\r\nТакс-такс\r\nЧто тут у нас?\r\nУ собак поскорей выбирайте окрас\r\nНа каждый день недели найдется\r\nМы все уедем от сердца и к солнцу\r\nТакс-такс\r\nЧто тут у нас?\r\n68 постов про донбасс\r\nСамые классные рэперы в мире\r\nСлава Аллаху и Украине!\r\n\r\n68 собак\r\nВ них Паша уехал назад\r\nЭто круче, чем смерть на футболе\r\nИ секс, и признание девочек в школе\r\n68 собак\r\nВ них Паша уехал назад\r\nВсего на три года угнал в далматине\r\nА кажется, будто на все четыре\r\n\r\n'),
(2, 'Noize MC ', 'Сохрани мою речь', 'Сохрани мою речь навсегда\r\nЗа привкус несчастья и дыма\r\nЗа смолу кругового терпения\r\nЗа совестный дёготь труда, как вода\r\nВ новгородских колодцах, должна быть, черна и сладима\r\nЧтобы в ней к рождеству отразилась семью плавниками звезда\r\nСохрани, сохрани мою речь навсегда\r\nЗапри вкус несчастья и дыма\r\nЗа смолу кругового терпения\r\nЗа совестный дёготь труда, как вода\r\nВ новгородских колодцах, должно быть, черна и сладима\r\nЧтобы в ней к рождеству отразилась семью плавниками звезда\r\nСохрани\r\nПоиграй со мной в реальную телепатию\r\nНе пророни ни слова по пути от отправителя к получателю\r\nОни подумают, что мы немые - ну и замечательно\r\nСохрани\r\nПронеси под носами ищеек натасканных\r\nМимо глазастых чинов при погонах и демонов в штатском\r\nСквозь обыски, ссылки, аресты и казни до станка типографского\r\nСохрани\r\nНаписано о памяти моей пером по памяти твоей, листу\r\nНе оступись по дороге на скользком льду\r\nКанал едва подмёрз, а идти ещё не одну версту\r\nСохрани\r\nВсё то, что только ты одна можешь сберечь\r\nПока ты есть, эту рукопись им не сжечь\r\nНе возьмёт ни костёр ни печь, меня уже не сохранить\r\nХрани мою речь\r\nСохрани, сохрани мою речь навсегда\r\nЗапри вкус несчастья и дыма\r\nЗа смолу кругового терпения\r\nЗа совестный дёготь труда, как вода\r\nВ новгородских колодцах, должно быть, черна и сладима\r\nЧтобы в ней к рождеству отразилась семью плавниками звезда\r\nСохрани, сохрани мою речь навсегда\r\nЗапри вкус несчастья и дыма\r\nЗа смолу кругового терпения\r\nЗа совестный дёготь труда, как вода\r\nВ новгородских колодцах, должно быть, черна и сладима\r\nЧтобы в ней к рождеству отразилась семью плавниками звезда\r\nСохрани мою речь, расти её, как младшую дочь\r\nПомоги ей, пожалуйста, всем, чем мама может помочь\r\nКачай и пой по ночам беззвучно\r\nПока не утихнет плачь и не пройдёт то, что её мучило\r\nСохрани навсегда, выведи на орбиту\r\nБез тебя она - чертежи ракеты\r\nОт Земли не да